import React from "react";
import ReactDOM from "react-dom/client";
// import { ReactDOM } from "react";

function App() {
  return (
    <div>
      <Header />
      <Catalog />
      <Footer />
    </div>
  );
}

function Item() {
  return (
    <div id="item">
      <h2>Folder</h2>
      <img
        src="https://godsgraceproducts.in/wp-content/uploads/2023/09/CF-1367-All-1.jpg"
        width={180}
        height={180}
        alt=""
      ></img>
    </div>
  );
}

function Header() {
  return (
    <div id="header">
      <h1
        style={{ color: "red", fontSize: "48px", textTransform: "uppercase" }}
      >
        God's Grace Distributions
      </h1>
    </div>
  );
}
function Catalog() {
  return (
    <div id="catalog">
      <h2>Our Catalog</h2>
      <Item />
      <Item />
      <Item />
    </div>
  );
}
function Footer() {
  const hour = new Date().getHours();
  const openHour = 10;
  const closeHour = 18;
  //   if (hour > openHour && hour <= closeHour) {
  //     alert("We're open!");
  //   } else {
  //     alert("Sorry we missed you!");
  //   }
  // const isOpen
  return (
    <div id="footer">
      <footer>We're currently open!</footer>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
